import React from "react";
import PropTypes from 'prop-types';

import './Login.css';
export default function Login() {
    return(
        <div className="login-wrapper">
            <h1>Please log in</h1>
            <form>
                <label htmlFor="">
                    <p>Email</p>
                    <input type="text"/>
                </label>
                <label htmlFor="">
                    <p>Password</p>
                    <input type="password"/>
                </label>
                <div>
                    <button type="submit">Submit</button>
                </div>
            </form>
        </div>
    )
}

Login.propTypes = {
    setToken: PropTypes.func.isRequired
}
